import { Routes, Route } from "react-router-dom";
import Homepage from "./pages/Homepage";
import Detail from "./pages/Detail";
function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/detail" element={<Detail/>} />
      </Routes>
    </div>
  );
}

export default App;
